// OntologyListItem.js
function OntologyListItem({ ontologyId, onSelect }) {
    const handleClick = () => {
        onSelect(ontologyId);
    }

    return (

        <div onClick={handleClick}>
            {ontologyId}
        </div>
    );
}

export default OntologyListItem;
